                        "Desc": "야호다가 원소전투 스킬 <color style='color:#FFD780;'>기책 · 부의 재분배</color> 발동 후 획득하는 작은 원소병.<br>야호다가 「그림자 습격」 상태일 때 주변의 적이 <color style='color:#FF9999;'>불 원소</color>, <color style='color:#80C0FF;'>물 원소</color>, <color style='color:#FFACFF;'>번개 원소</color> 또는 <color style='color:#99FFFF;'>얼음 원소</color>가 부착된 상태인 경우, 냥냥병이 상응하는 원소 타입으로 전환되고 지속적으로 충전된다. <color style='color:#FF9999;'>불 원소</color>, <color style='color:#80C0FF;'>물 원소</color>, <color style='color:#FFACFF;'>번개 원소</color>, <color style='color:#99FFFF;'>얼음 원소</color> 순서로 전환된다. 원소전투 스킬을 발동할 때마다 냥냥병은 최대 1회 전환된다.<br>냥냥병이 충전 완료되면 야호다의 「그림자 습격」 상태가 종료되고 주변의 적에게 <color style='color:#80FFD7;'>바람 원소 피해</color>를 1회 주고 냥냥병은 비워진다.<br>원소전투 스킬을 발동할 때마다 야호다는 새로운 냥냥병을 획득한다.<br><br><color style='color:#FFD780;'>달빛 징조 · 보름</color>: <color style='color:#FFD780;'>냥냥병</color> 충전 완료 시, 야호다는 즉시 <color style='color:#FFD780;'>냥냥병</color>을 비우지 않고 일정 시간 동안 병에 충전된 원소를 지속적으로 소모해, 주변의 적에게 간헐적으로 <color style='color:#FFD780;'>냥냥볼</color>을 발사하여 <color style='color:#FFD780;'>냥냥병</color>에 대응하는 원소 타입의 피해를 준다"
