                        "Desc": "야호다가 적을 향해 돌진한다. 적과 접촉 시 「그림자 습격」 상태에 진입한다. 해당 상태에서 야호다는 계속해서 빠르게 이동한다. 주변의 적이 <color style='color:#FF9999;'>불 원소</color>, <color style='color:#80C0FF;'>물 원소</color>, <color style='color:#FFACFF;'>번개 원소</color> 또는 <color style='color:#99FFFF;'>얼음 원소</color> 부착 상태일 경우, 야호다는 몰래 가지고 있던 <color style='color:#FFD780;'>냥냥병</color>을 대응하는 원소 속성으로 전환한 후 지속적으로 병을 충전한다. 지속 시간이 끝나거나 재발동 시, 야호다는 <color style='color:#FFD780;'>냥냥병</color>을 비우고 주변의 적에게 <color style='color:#80FFD7;'>바람 원소 피해</color>를 1회 준다. <color style='color:#FFD780;'>냥냥병</color> 충전 완료 시, 야호다는 <color style='color:#FFD780;'>냥냥병</color>을 비우고 그림자 습격 상태를 종료하며, 주변의 적에게 더 큰 <color style='color:#80FFD7;'>바람 원소 피해</color>를 1회 준다.<br>만약 야호다의 돌진이 적에게 닿지 않은 경우, 야호다는 그 자리에서 연막탄 1개를 던져 주변의 적에게 <color style='color:#80FFD7;'>바람 원소 피해</color>를 1회 준다.<br><br><color style='color:#FFD780;'>달빛 징조 · 보름</color>: <color style='color:#FFD780;'>냥냥병</color> 충전 완료 시, 야호다는 <color style='color:#FFD780;'>냥냥병</color>을 즉시 비우지 않고 일정 시간 동안 병에 채워진 원소를 지속적으로 소모하며, 주변의 적에게 간헐적으로 <color style='color:#FFD780;'>냥냥볼</color>을 발사해 <color style='color:#FFD780;'>냥냥병</color>과 대응하는 원소 타입 피해를 준다. <color style='color:#FFD780;'>냥냥볼</color>이 적에게 명중 시, 야호다의 원소 에너지가 2pt 회복된다. 해당 효과는 3.5초마다 최대 1회 발동된다.<br><br><i>세상에는 재산을 분배하는 방법이 아주 많지만, 노드크라이의 보물 사냥꾼과 보물 사냥단에게 가장 효율적인 분배 방식은 언제나 하나뿐이다</i>",
